import React from "react";

export default function About() {
  return (
    <div>
      <h1>About Our Coffee Shop</h1>
      <p>
        At Daily Grind Coffee House, we believe that every cup of coffee tells a story.
        Nestled in the heart of Bongabong,  we're more than just a coffee shop-we're a place where 
        a place where early risers, late-night thinkers, and weekend wanderers come together over 
        expertly brewed coffee and handcrafted treats. 
      </p>
      <p>
        We source our beans directly from small farms and roast them with care.
      </p>
    </div>
  );
}
